import { useEffect, useState } from 'react';


 function AddProduct()
 {
    const [data,setdata] = useState([]);

    useEffect(async ()=>{
    let  response = await fetch("http://localhost:8000/api/get-all",{
        method: 'POST',
       body: JSON.stringify(data),
       headers: {
         'Content-Type': 'application/json',
         'Accept': 'application/json'
       }
    });
    response =await response.json();
     setdata(response);

    },[])
  console.log("data",data);
  
    return(
        <div>
            <h1>AddProduct Page</h1>
            <table>
              <thead>
                <tr>
                  <th>Month</th>
                  <th>Savings</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>January</td>
                  <td>$100</td>
                </tr>
                <tr>
                  <td>February</td>
                  <td>$80</td>
                </tr>
              </tbody>
              <tfoot>
                <tr>
                  <td>Sum</td>
                  <td>$180</td>
                </tr>
              </tfoot>
            </table>
        </div>
    )
 }
 export default AddProduct;
